import React from 'react';
import classes from './TopBar.module.css'

const TopBar = () => {
  return (
    <div className={classes.wrap}>
      <div className={[classes.info, classes.info]}>О нас</div>
      <div className={classes.order}>Сделать заказ</div>
      <div className={classes.auth}>Вход / Регистрация</div>
    </div>
  );
};
export default TopBar;
